The Four (2012) &quot;Si da ming bu&quot; (original title) 

118 min  -  Action | Crime | Fantasy  -  12 July 2012 (Hong Kong)

When counterfeit bills appear in the capital city of the Song Dynasty, the court-run Six Fan Gate Constabulary and the independent Divine Constabulary are assigned to investigate. Coldblood of Six Fan Gate is sent undercover to Divine, where he befriends fellow independent constables Life Snatcher and Iron Hand, as well as the beautiful Emotionless. Emotionless discovers Coldblood's identity but growing affection between the two keeps her from telling anyone. Coldblood causes the shut down of Divine but before he has time to regret it he becomes involved in a battle against God of Wealth who plots to overthrow the government...

Stars: Chao Deng, Yifei Liu, Ronald Cheng


